import axios from 'axios';

const API_URL = 'http://localhost:3000/personas';

export const getPersonas = async () => {
    try {
        const response = await axios.get(API_URL);
        return response;
    } catch (error) {
        console.error("Error fetching personas:", error);
        return { data: [] };
    }
};
